import Birthday from './Birthday'

export default function BirthdayList(props) {
/*   const birthdayConstructor = (birthdayList) => {
    birthdayList.forEach(birthday => {
      return (`
        <h3>${birthday.date}</h3>
        <h3>${birthday.firstName}</h3>
        <h3>${birthday.lastName}</h3>`
      )
    });
  } */
  return (
    <h3>
      ${props.birthdayList.forEach(birthday => {
        <Birthday 
          date= {birthday.date}
          firstName= {birthday.firstName}
          lastName= {birthday.lastName}
        />
      })}
    </h3>
  )
}
